    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1599236366361,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1608657660731,"commentText":"It turns out that I have been using pointers since I explained arrays. Plain old arrays are really just pointers to a chunk of memory. Array notation with square brackets is a way to manipulate these pointers to access the elements in the chunk of memory that the pointer points to.","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"","linesBelow":"","currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-102":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-102","timestamp":1509653411388,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":102,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-101","lineNumber":7,"column":19,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608657687983,"commentText":"This creates a plain old array of five <font face=\"Courier\">floats</font>. When the flow of control reaches this declaration three things happen:<div>- a chunk of memory is set aside in memory big enough to hold five <font face=\"Courier\">floats</font></div><div>- a <font face=\"Courier\">float</font> pointer called <font face=\"Courier\">arr</font> is created</div><div>- the address of the first byte of the first <font face=\"Courier\">float</font> is stored inside the pointer <font face=\"Courier\">arr</font></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float arr[5];","startRow":6,"startColumn":4,"endRow":6,"endColumn":17}],"imageURLs":["media/images/1608656735611-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"3","currentFilePath":"/main.cpp","viewableBlogText":"int main() \n{ \n    float arr[5]; \n \n    return 0; \n}","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-173":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-173","timestamp":1509653426539,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":173,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-172","lineNumber":11,"column":25,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608657274444,"commentText":"This creates another <font face=\"Courier\">float</font> pointer called <font face=\"Courier\">p_copy_array</font>. Since pointers are really just addresses this new pointer is assigned the same value that is in the pointer <font face=\"Courier\">arr</font>. Both pointers point to the same thing.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"float* p_copy_array; \n \n    p_copy_array = arr; ","startRow":8,"startColumn":4,"endRow":10,"endColumn":24}],"imageURLs":["media/images/1608656815574-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"2","linesBelow":"0","currentFilePath":"/main.cpp","viewableBlogText":"    float arr[5]; \n \n    float* p_copy_array; \n \n    p_copy_array = arr; ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}],"ev-272":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-272","timestamp":1509653440715,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":272,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-271","lineNumber":16,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609280125287,"commentText":"There are two ways to access the elements of an array. The first is to explicitly use a pointer and dereference it. Pointer arithmetic allows you to add to an address and move over some number of elements from the address.<div><br></div><div>When I add to the address in the pointer I am not moving single bytes away from the address I am moving the size of whole <font face=\"Courier\">floats</font> away from it. Since the pointer is declared as a <font face=\"Courier\">float</font> pointer the system knows to move over the size of <font face=\"Courier\">i floats </font>from the beginning address before assigning a value of 0 to each element. <br></div><div><br></div><div>This is another reason why pointers need a type. The type determines how many bytes to move when performing pointer arithmetic.</div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"*(p_copy_array + i) = 0.0;","startRow":13,"startColumn":2,"endRow":13,"endColumn":28}],"imageURLs":["media/images/1608657338168-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"7","linesBelow":"2","currentFilePath":"/main.cpp","viewableBlogText":"    float arr[5]; \n \n    float* p_copy_array; \n \n    p_copy_array = arr; \n\tfor (int i = 0; i < 5; i++) \n\t{ \n\t\t*(p_copy_array + i) = 0.0; \n\t\tcout << arr[i] << endl; \n\t} ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}},{"id":"commentId-4","displayCommentEvent":{"id":"ev-272","timestamp":1509653440715,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":272,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-271","lineNumber":16,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1609280550485,"commentText":"The other way to access the elements of the array is to use array notation. Array notation is just a shorthand way of performing pointer arithmetic:<div><br></div><div><font face=\"Courier\">arr[i]</font> is exactly equivalent to <font face=\"Courier\">*(arr + i)</font></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"arr[i]","startRow":14,"startColumn":10,"endRow":14,"endColumn":16}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":"8","linesBelow":"1","currentFilePath":"/main.cpp","viewableBlogText":"    float arr[5]; \n \n    float* p_copy_array; \n \n    p_copy_array = arr; \n\tfor (int i = 0; i < 5; i++) \n\t{ \n\t\t*(p_copy_array + i) = 0.0; \n\t\tcout << arr[i] << endl; \n\t} ","commentTags":[],"questionCommentData":{"allAnswers":["True","False"],"correctAnswer":"True","question":"True or false, earlier I said that plain old arrays are passed in by reference by default. Under the hood the compiler uses pointer syntax like this void printStringArr(string* p_strings, int numElements)?"}}],"ev-381":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-381","timestamp":1509653456342,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":381,"type":"INSERT","fileId":"fileId-0","character":"\n","previousNeighborId":"ev-380","lineNumber":24,"column":4,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1608657592296,"commentText":"This means that I can use array notation with <font face=\"Courier\">p_copy_array</font> too and the compiler will allow me to access the elements.","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"for (int i = 0; i < 5; i++) \n\t{ \n\t\tcout << p_copy_array[i] << endl; \n\t}","startRow":20,"startColumn":1,"endRow":23,"endColumn":2}],"imageURLs":["media/images/1608657561295-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"8","linesBelow":"0","currentFilePath":"/main.cpp","viewableBlogText":"    for (int i = 0; i < 5; i++) \n\t{ \n\t\t*(p_copy_array + i) = 0.0; \n\t\tcout << arr[i] << endl; \n\t} \n \n\tcout << endl; \n \n\tfor (int i = 0; i < 5; i++) \n\t{ \n\t\tcout << p_copy_array[i] << endl; \n\t} ","commentTags":[],"questionCommentData":{"allAnswers":[],"correctAnswer":"","question":""}}]};
